import React from 'react'
import './Parthners.scss';

export default function Parthners({parthners}) {

  return (
    <div className="Parthners container">
      {parthners.map (p => {
        return (
          <div className="Parthners__item">
            {p}
          </div>
        )
      })}
    </div>
  )
}
